import React from "react";
import ImageGallery from "react-image-gallery";

class MyComponent extends React.Component {
    render() {
      const images = [
        {
          original: "https://unsplash.it/400/300/?image=511"
        },
        {
          original: "https://unsplash.it/400/300/?image=513"
        },
        {
          original: "https://unsplash.it/400/300/?image=510"
        }
      ];
  
      const someComponent = (props) => {
        //console.log(props.someProps.objectKey)
        return <div>{/* {props.someProps.objectKey} */}</div>;
      };
  
      return (
        <ImageGallery
          items={images}
          defaultImage="https://unsplash.it/400/300/?image=511"
          showBullets={true}
          showIndex={true}
          showThumbnails={false}
          lazyLoad={true}
          showPlayButton={false}
          renderCustomControls={someComponent}
        />
      );
    }
}
export default MyComponent;
